import React, { useState } from 'react';
import Editor from './Editor'; // Adjust the path as necessary

function App() {
  const [value, setValue] = useState("console.log('Hello, World!');\n".repeat(10));

  // Specify line numbers and their styles
  const specialLineStyles = [
    { line: 2, color: '#f00', fontSize: '14px' },
    { line: 4, color: '#00f', fontSize: '16px' },
  ];

  const onChange = (newValue) => {
    setValue(newValue);
  };

  return (
    <div>
      <Editor value={value} onChange={onChange} specialLineStyles={specialLineStyles} />
    </div>
  );
}

export default App;
